function initSweetalertAlert() {
  document.getElementById("sweetalertAlert").addEventListener("click", function (t) {
    t.preventDefault(), Swal.fire({
      title: "Are you sure?",
      text: "You won't be able to revert this!",
      icon: "warning",
      showCancelButton: !0,
      confirmButtonColor: "#3085d6",
      cancelButtonColor: "#d33",
      confirmButtonText: "Yes, delete it!"
    }).then(function (t) {
      t.isConfirmed && Swal.fire("Deleted!", "Your file has been deleted.", "success");
    });
  });
}
function initSweetalertConfirm() {
  document.getElementById("sweetalertConfirm").addEventListener("click", function (t) {
    t.preventDefault();
    var e = Swal.mixin({
      customClass: {
        confirmButton: "btn btn-success",
        cancelButton: "btn btn-danger"
      },
      buttonsStyling: !1
    });
    e.fire({
      title: "Are you sure?",
      text: "You won't be able to revert this!",
      icon: "warning",
      showCancelButton: !0,
      confirmButtonText: "Yes, delete it!",
      cancelButtonText: "No, cancel!",
      reverseButtons: !0
    }).then(function (t) {
      t.isConfirmed ? e.fire("Deleted!", "Your file has been deleted.", "success") : t.dismiss === Swal.DismissReason.cancel && e.fire("Cancelled", "Your imaginary file is safe :)", "error");
    });
  });
}
function initSweetalertMixin() {
  document.getElementById("sweetalertMixin").addEventListener("click", function (t) {
    t.preventDefault(), Swal.mixin({
      toast: !0,
      position: "top-end",
      showConfirmButton: !1,
      timer: 3e3,
      timerProgressBar: !0,
      didOpen: function didOpen(t) {
        t.addEventListener("mouseenter", Swal.stopTimer), t.addEventListener("mouseleave", Swal.resumeTimer);
      }
    }).fire({
      icon: "success",
      title: "Signed in successfully"
    });
  });
}
